export const EMBEDDED_FONTS = {
  BAHNSCHRIFT_TTF:
    "",
  SCHEHERAZADENEW_REGULAR_TTF:
    "",
  SCHEHERAZADENEW_MEDIUM_TTF:
    "",
  SCHEHERAZADENEW_SEMIBOLD_TTF:
    "",
  SCHEHERAZADENEW_BOLD_TTF:
    "",
} as const;

export type FontName = keyof typeof EMBEDDED_FONTS;

export function getFontBuffer(fontName: FontName): Uint8Array {
  const base64Data = EMBEDDED_FONTS[fontName];
  const binaryString = atob(base64Data);
  const bytes = new Uint8Array(binaryString.length);
  for (let i = 0; i < binaryString.length; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes;
}
